import classes from 'desc.module.css'
const Desc = (props) => {
  return (
    <section className={theme ? classes.sCon : classes.sCon + ' pureDark'}>
         <h2>Description</h2>
         <div className={theme ? classes.con : classes.con + ' dark'}>
            <p>
                {props.desc}
            </p>
         </div>
    </section>
  )
}

export default Desc
